INSERT INTO badges VALUES(497,19711056,36,'t_36_1_sum_1','New Badge','Quiet day',4000,'','It’s the first time you’ve reached 4 000 steps in a day.','Did you know the World Health Organization advises to walk at least 20 minutes a day?','','','Congratulations for unlocking the Quiet day badge!','Awesome! I unlocked the Quiet day badge with @Withings ! #StepsChallenge http://within.gs/map/en/75g/t','2019-10-17');
