INSERT INTO badges VALUES(499,19711056,40,'t_40_5_sum_1','New Badge','Marathon',42,'km','42 km, the distance of a marathon.','According to legend, a Greek soldier ran from the Marathon battle site all the way to Athens to announce the victory. The official length of the race was established following the London Olympic Games in 1908.','https://en.wikipedia.org/wiki/Marathon_(sport)','https://www.instagram.com/explore/tags/marathon/','Congratulations for unlocking the Marathon badge!','I made it! I unlocked the Marathon badge with @Withings ! #StepsChallenge http://within.gs/map/en/64f/t','2020-01-11');
INSERT INTO badges VALUES(500,19711056,40,'t_40_5_sum_2','New Badge','Loch Ness',100,'km','100 km, tour of Loch Ness.','Loch Ness is a freshwater lake in the Scottish Highlands and is known for its monster, "Nessie". Originating in the seventh century, this legend became popular in 1933 through the famous photo made by Hugh Gray.','https://en.wikipedia.org/wiki/Loch_Ness','https://instagram.com/visitinvernesslochness/','Congratulations for unlocking the Loch Ness badge!','Good news! I unlocked the Loch Ness badge with @Withings ! #StepsChallenge http://within.gs/map/en/48q/t','2020-02-03');
INSERT INTO badges VALUES(501,19711056,40,'t_40_5_sum_3','New Badge','Bahamas',170,'km','170 km, crossing the Bahamas.','Christopher Columbus first set foot in the New World on October 12, 1492, on the island of San Salvador, located in the Bahamas. He encountered Arawaks there and exchanged presents with them.','https://en.wikipedia.org/wiki/Bahamas','https://instagram.com/VisitTheBahamas/','Congratulations for unlocking the Bahamas badge!','Finally! I unlocked the Bahamas badge with @Withings ! #StepsChallenge http://within.gs/map/en/hgf/t','2020-03-09');
