INSERT INTO badges VALUES(511,19711056,37,'t_37_5_sum_1','New Badge','Eiffel Tower',320,'m','320 m, at the top of the Eiffel Tower.','The Eiffel Tower is the tallest monument in Paris. It was designed by engineer Gustave Eiffel for the 1889 World''s Fair.','https://en.wikipedia.org/wiki/Eiffel_Tower','https://instagram.com/toureiffelofficielle/','Congratulations for unlocking the Eiffel Tower badge!','Look! I unlocked the Eiffel Tower badge with @Withings ! #StepsChallenge http://within.gs/map/en/e12/t',NULL);
INSERT INTO badges VALUES(512,19711056,37,'t_37_5_sum_2','New Badge','Burj Khalifa',830,'m','830 m, at the top of the Burj Khalifa skyscraper.','Burj Khalifa is a skyscraper found in Dubai, United Arab Emirates. Rising to a height of 829.8 m (2,722 ft), it is the world''s tallest building.','https://en.wikipedia.org/wiki/Burj_Khalifa','https://instagram.com/burjkhalifa/','Congratulations for unlocking the Burj Khalifa badge!','Awesome! I unlocked the Burj Khalifa badge with @Withings ! #StepsChallenge http://within.gs/map/en/5f1/t',NULL);
INSERT INTO badges VALUES(513,19711056,37,'t_37_5_sum_3','New Badge','First human flight',1000,'m','1 000 m, as high as the first human flight.','Jean-François Pilâtre de Rozier was a French professor and aviation pioneer. He was the first human to fly in a hot-air balloon in 1783.','https://en.wikipedia.org/wiki/Jean-Fran%C3%A7ois_Pil%C3%A2tre_de_Rozier','https://flic.kr/p/nYCPnp','Congratulations for unlocking the First human flight badge!','I did it! I unlocked the First human flight badge with @Withings ! #StepsChallenge http://within.gs/map/en/e5r/t',NULL);
INSERT INTO badges VALUES(514,19711056,37,'t_37_5_sum_4','New Badge','Mount Aso',1600,'m','1 600 m, at the top of Mount Aso.','Mount Aso is the largest active volcano in Japan and one of the world''s biggest. It is located on Kyushu Island.','https://en.wikipedia.org/wiki/Mount_Aso','https://flic.kr/p/7A8w8V','Congratulations for unlocking the Mount Aso badge!','I made it! I unlocked the Mount Aso badge with @Withings ! #StepsChallenge http://within.gs/map/en/re8/t',NULL);
INSERT INTO badges VALUES(515,19711056,37,'t_37_5_sum_5','New Badge','Machu Picchu',2400,'m','2 400 m, at the highest point of Machu Picchu.','Machu Picchu ("old mountain" in Quechua) is an ancient Inca city in Peru; it dates from the fifteenth century and sits on a rocky promontory in the central Andes.','https://en.wikipedia.org/wiki/Machu_Picchu','https://www.instagram.com/explore/tags/machupichu/','Congratulations for unlocking the Machu Picchu badge!','Good news! I unlocked the Machu Picchu badge with @Withings ! #StepsChallenge http://within.gs/map/en/ze7/t',NULL);
INSERT INTO badges VALUES(516,19711056,37,'t_37_5_sum_6','New Badge','Qurnat as Sawda''',3000,'m','3 000 m, at the top of Qurnat as Sawda''.','Qurnat as Sawda'' is a mountain in Lebanon. At 3,088 m, it is the highest point in the country; a forest of Lebanon cedars is found at its foot.','https://en.wikipedia.org/wiki/Qurnat_as_Sawda%27','https://flic.kr/p/5HKs7c','Congratulations for unlocking the Qurnat as Sawda'' badge!','Finally! I unlocked the Qurnat as Sawda'' badge with @Withings ! #StepsChallenge http://within.gs/map/en/s54/t',NULL);
INSERT INTO badges VALUES(517,19711056,37,'t_37_5_sum_7','New Badge','Mount Fuji',3776,'m','3 776 m, at the top of Mount Fuji.','Mount Fuji is the highest peak in Japan. Located almost 100 km southwest of Tokyo on Honshu Island, it can be seen from the city in clear weather.','https://en.wikipedia.org/wiki/Mount_Fuji','https://flic.kr/p/7Znzed','Congratulations for unlocking the Mount Fuji badge!','Look! I unlocked the Mount Fuji badge with @Withings ! #StepsChallenge http://within.gs/map/en/456/t',NULL);
INSERT INTO badges VALUES(518,19711056,37,'t_37_5_sum_8','New Badge','Mont Blanc',4810,'m','4 810 m, at the top of Mont Blanc.','Mont Blanc is the highest peak in the Alps and the European Union. Sometimes called the "Lady in White", it is the eleventh-highest topographical elevation worldwide.','https://en.wikipedia.org/wiki/Mont_Blanc','https://www.instagram.com/explore/tags/montblanc','Congratulations for unlocking the Mont Blanc badge!','Awesome! I unlocked the Mont Blanc badge with @Withings ! #StepsChallenge http://within.gs/map/en/4z5/t',NULL);
INSERT INTO badges VALUES(519,19711056,37,'t_37_5_sum_9','New Badge','Mount Kilimanjaro',5895,'m','5 895 m, at the top of Mount Kilimanjaro.','Mount Kilimanjaro is a dormant volcano which is composed of three domes: Kibo, Mawenzi and Shira. It is the highest peak in Tanzania and in Africa.','https://en.wikipedia.org/wiki/Mount_Kilimanjaro','https://instagram.com/visit.tanzania/','Congratulations for unlocking the Mount Kilimanjaro badge!','I did it! I unlocked the Mount Kilimanjaro badge with @Withings ! #StepsChallenge http://within.gs/map/en/ghj/t',NULL);
INSERT INTO badges VALUES(520,19711056,37,'t_37_5_sum_10','New Badge','Denali',6194,'m','6 194 m, at the top of Denali.','Denali is the highest mountain in North America. Located in the heart of Alaska, it is one of the world''s most difficult peaks because of its extreme climate.','https://en.wikipedia.org/wiki/Denali','https://flic.kr/p/71CkD2','Congratulations for unlocking the Denali badge!','I made it! I unlocked the Denali badge with @Withings ! #StepsChallenge http://within.gs/map/en/7te/t',NULL);
INSERT INTO badges VALUES(521,19711056,37,'t_37_5_sum_11','New Badge','Mount Aconcagua',6962,'m','6 962 m, at the top of Mount Aconcagua.','The Aconcagua is the highest peak in the Americas. Located in the Andes mountain range, it is known as the "Colossus of America."','https://en.wikipedia.org/wiki/Aconcagua','https://flic.kr/p/6ah4h3','Congratulations for unlocking the Mount Aconcagua badge!','Good news! I unlocked the Mount Aconcagua badge with @Withings ! #StepsChallenge http://within.gs/map/en/fdq/t',NULL);
INSERT INTO badges VALUES(522,19711056,37,'t_37_5_sum_12','New Badge','Nanda Devi',7816,'m','7 816 m, at the top of Nanda Devi.','Nanda Devi, which means "joyful goddess", is the highest mountain found entirely on Indian territory. It is also the highest peak in the Garhwal range.','https://en.wikipedia.org/wiki/Nanda_Devi','https://flic.kr/p/9puSNz','Congratulations for unlocking the Nanda Devi badge!','Finally! I unlocked the Nanda Devi badge with @Withings ! #StepsChallenge http://within.gs/map/en/ty4/t',NULL);
INSERT INTO badges VALUES(523,19711056,37,'t_37_5_sum_13','New Badge','Mount Everest',8848,'m','8 848 m, at the top of Mount Everest.','Mount Everest, known as "Chomolungma" in Tibetan and "Sagarmatha" in Nepalese, is a mountain in the Himalayas. At 8,848 m, it is the world''s highest peak.','https://en.wikipedia.org/wiki/Everest','https://flic.kr/p/6GncDT','Congratulations for unlocking the Mount Everest badge!','Look! I unlocked the Mount Everest badge with @Withings ! #StepsChallenge http://within.gs/map/en/57d/t',NULL);
INSERT INTO badges VALUES(524,19711056,37,'t_37_5_sum_14','New Badge','Boeing 707',9500,'m','9 500 m, as high as the cruising altitude of a Boeing 707.','The 707 is a four-engine plane developed in the fifties by Boeing. It was the first commercial jet to be mass produced and inaugurated the Seattle aircraft manufacturer''s 7x7 series.','https://en.wikipedia.org/wiki/Boeing_707','https://flic.kr/p/77Twz6','Congratulations for unlocking the Boeing 707 badge!','Awesome! I unlocked the Boeing 707 badge with @Withings ! #StepsChallenge http://within.gs/map/en/q75/t',NULL);
INSERT INTO badges VALUES(525,19711056,37,'t_37_5_sum_15','New Badge','Mauna Kea',10200,'m','10 200 m, the height of Mauna Kea from the ocean floor.','Mauna Kea is a volcano on the island of Hawaii. Although it rises 4,205 m (13,796 ft) above sea level, its main part is located under water: measured from the ocean floor, it reaches 10,200 m (33,500 ft).','https://en.wikipedia.org/wiki/Mauna_Kea','https://flic.kr/p/6kXkpU','Congratulations for unlocking the Mauna Kea badge!','I did it! I unlocked the Mauna Kea badge with @Withings ! #StepsChallenge http://within.gs/map/en/f7s/t',NULL);
INSERT INTO badges VALUES(526,19711056,37,'t_37_5_sum_16','New Badge','B-2 Spirit',15200,'m','15 200 m, as high as the cruising altitude of a B-2 Spirit.','Developed by the US Air Force during the Cold War, the B-2 Spirit is a stealth plane that can fly at an altitude of 15,200 meters (50,000 ft). It is currently considered to be the world''s best strategic bomber.','https://en.wikipedia.org/wiki/Northrop_Grumman_B-2_Spirit','https://flic.kr/p/ciahf5','Congratulations for unlocking the B-2 Spirit badge!','I made it! I unlocked the B-2 Spirit badge with @Withings ! #StepsChallenge http://within.gs/map/en/f7s/t',NULL);
INSERT INTO badges VALUES(527,19711056,37,'t_37_5_sum_17','New Badge','Concorde',18000,'m','18 000 m, as high as the cruising altitude of Concorde.','The Concorde, which was the product of a Franco-British cooperation, flew at a cruising altitude of 18,000 m. It is one of the two only civilian supersonic planes that have ever been built.','https://en.wikipedia.org/wiki/Concorde','https://flic.kr/p/6247uW','Congratulations for unlocking the Concorde badge!','I made it! I unlocked the Concorde badge with @Withings ! #StepsChallenge http://within.gs/map/en/q3o/t',NULL);
INSERT INTO badges VALUES(528,19711056,37,'t_37_5_sum_18','New Badge','Weather balloon',35000,'m','35 000 m, as high as a weather balloon.','The first weather balloon was sent from Trappes (France) in 1929. Today, weather balloons are sent to an altitude of 35,000 meters to take meteorological and astronomical measures.','https://en.wikipedia.org/wiki/Weather_balloon','https://flic.kr/p/9d4nxZ','Congratulations for unlocking the Weather balloon badge!','I made it! I unlocked the Weather balloon badge with @Withings ! #StepsChallenge http://within.gs/map/en/m9o/t',NULL);
INSERT INTO badges VALUES(529,19711056,37,'t_37_5_sum_19','New Badge','Stratos',39000,'m','39 000 m, as high as the Supersonic Jump.','Austrian skydiver Felix Baumgartner rose to 39,000 m, reaching the stratosphere over New Mexico in a helium balloon before performing a record-breaking free fall.','https://en.wikipedia.org/wiki/Felix_Baumgartner','https://instagram.com/redbullstratos/','Congratulations for unlocking the Stratos badge!','I made it! I unlocked the Stratos badge with @Withings ! #StepsChallenge http://within.gs/map/en/f4x/t',NULL);
INSERT INTO badges VALUES(530,19711056,37,'t_37_5_sum_20','New Badge','Virgin Galactic',100000,'m','100 000 m, as high as the Virgin Galactic space voyage.','Virgin Galactic plans on sending 500 passengers per year in orbit, at an altitude of 100 km and a for a total of 3 to 4 minutes in weightlessness. Ticket price: $200,000.','https://en.wikipedia.org/wiki/Virgin_Galactic','https://flic.kr/p/cxVJL5','Congratulations for unlocking the Virgin Galactic badge!','I made it! I unlocked the Virgin Galactic badge with @Withings ! #StepsChallenge http://within.gs/map/en/v2g/t',NULL);
INSERT INTO badges VALUES(531,19711056,37,'t_37_5_sum_21','New Badge','Sputnik',230000,'m','230 000 m, the height of the Sputnik satellite’s perigee.','Sputnik 1, launched October 4th, 1957, was the first object to be put in orbit around Earth. It marks the beginning of space age. This satellite was created by Sergei Korolev, an engineer whose name was kept secret for reasons of national security.','https://en.wikipedia.org/wiki/Sputnik_1','https://flic.kr/p/kzBpLR','Congratulations for unlocking the Sputnik badge!','I made it! I unlocked the Sputnik badge with @Withings ! #StepsChallenge http://within.gs/map/en/s1p/t',NULL);
INSERT INTO badges VALUES(532,19711056,40,'t_40_5_sum_4','New Badge','Suez Canal',200,'km','200 km, the length of the Suez Canal.','Through three natural lakes, the Suez Canal links the Mediterranean and the Red Sea. Inaugurated in 1869 after ten years of work, it allows ships to go from Europe to Asia without having to go around Africa.','https://en.wikipedia.org/wiki/Suez_canal','https://instagram.com/port.said/','Congratulations for unlocking the Suez Canal badge!','Look! I unlocked the Suez Canal badge with @Withings ! #StepsChallenge http://within.gs/map/en/ae8/t',NULL);
INSERT INTO badges VALUES(533,19711056,40,'t_40_5_sum_5','New Badge','O''ahu Island',330,'km','330 km, the length of the coastline of O''ahu.','O’ahu is the most populous of the islands making up the state of Hawaii and is home to Honolulu, the capital. Hawaii is the newest of the fifty U.S. states, having joined the union in 1959.','https://en.wikipedia.org/wiki/Oahu','https://instagram.com/oahuvb/','Congratulations for unlocking the O''ahu Island badge!','Awesome! I unlocked the O''ahu Island badge with @Withings ! #StepsChallenge http://within.gs/map/en/yt5/t',NULL);
INSERT INTO badges VALUES(534,19711056,40,'t_40_5_sum_6','New Badge','Galapagos',410,'km','410 km, tour of the Galapagos Islands.','The Galápagos Islands, also called Archipel de Colón, are an equatorial archipelago located in the eastern Pacific Ocean, 965 km from the coast of South America.','https://en.wikipedia.org/wiki/Gal%C3%A1pagos_Islands','https://instagram.com/galapagosisland/','Congratulations for unlocking the Galapagos badge!','I did it! I unlocked the Galapagos badge with @Withings ! #StepsChallenge http://within.gs/map/en/yd9/t',NULL);
INSERT INTO badges VALUES(535,19711056,40,'t_40_5_sum_7','New Badge','Lake Titicaca',510,'km','510 km, tour of Lake Titicaca.','Lake Titicaca is considered to be the highest navigable lake in the world. Located in the Andes Mountains on the border between Bolivia and Peru, it is also the largest lake in South America in water volume and length.','https://en.wikipedia.org/wiki/Titicaca','https://instagram.com/visitbolivia/','Congratulations for unlocking the Lake Titicaca badge!','I made it! I unlocked the Lake Titicaca badge with @Withings ! #StepsChallenge http://within.gs/map/en/3hg/t',NULL);
INSERT INTO badges VALUES(536,19711056,40,'t_40_5_sum_8','New Badge','Jamaica',620,'km','620 km, tour of Jamaica.','Jamaica is an island in the Caribbean Sea which became independent from the United Kingdom in 1962. The name of the country comes from the word Xamayca, meaning "land of wood and water".','https://en.wikipedia.org/wiki/Jamaica','https://instagram.com/visitjamaica','Congratulations for unlocking the Jamaica badge!','Good news! I unlocked the Jamaica badge with @Withings ! #StepsChallenge http://within.gs/map/en/sq5/t',NULL);
INSERT INTO badges VALUES(537,19711056,40,'t_40_5_sum_9','New Badge','Lake Baikal ',720,'km','720 km, tour of Lake Baikal.','Lake Baikal is the world''s largest reserve of liquid freshwater (approximately 23,500 km³). Located in southern Siberia in the east of Russia, it is sometimes called the "Pearl of Siberia".','https://en.wikipedia.org/wiki/Lake_Baikal','https://instagram.com/baikal_russia/','Congratulations for unlocking the Lake Baikal badge!','Finally! I unlocked the Lake Baikal  badge with @Withings ! #StepsChallenge http://within.gs/map/en/rf7/t',NULL);
INSERT INTO badges VALUES(538,19711056,40,'t_40_5_sum_10','New Badge','Costa Rica',800,'km','800 km, the length of Costa Rica.','Costa Rica is a republic in Central America. Most of its territory is located on the Central American isthmus, which is surrounded by the Caribbean Sea and the Pacific Ocean.','https://en.wikipedia.org/wiki/Costa_rica','https://instagram.com/visit_costarica/','Congratulations for unlocking the Costa Rica badge!','Look! I unlocked the Costa Rica badge with @Withings ! #StepsChallenge http://within.gs/map/en/a54/t',NULL);
INSERT INTO badges VALUES(539,19711056,40,'t_40_5_sum_11','New Badge','Sicily',900,'km','900 km, tour of Sicily.','Sicily is an autonomous region of Italy and the largest island in the Mediterranean. Its capital is the city of Palermo. The Sicilian flag features the three-legged Gorgon, representing the three points of the island.','https://en.wikipedia.org/wiki/Sicily','https://instagram.com/sicilytourism/','Congratulations for unlocking the Sicily badge!','Awesome! I unlocked the Sicily badge with @Withings ! #StepsChallenge http://within.gs/map/en/7yt/t',NULL);
INSERT INTO badges VALUES(540,19711056,40,'t_40_5_sum_12','New Badge','Java Island',1000,'km','1 000 km, crossing Java Island.','Java is the world''s most populous island and is home to nearly 50% of the population of Indonesia. Jakarta, the capital of Indonesia, is located on the northwest coast of Java.','https://en.wikipedia.org/wiki/Java','https://instagram.com/explorejava/','Congratulations for unlocking the Java Island badge!','I did it! I unlocked the Java Island badge with @Withings ! #StepsChallenge http://within.gs/map/en/8rt/t',NULL);
INSERT INTO badges VALUES(541,19711056,40,'t_40_5_sum_13','New Badge','Saint Lawrence',1100,'km','1 100 km, the length of the St. Lawrence river.','The St. Lawrence river connects the Great Lakes with the Atlantic Ocean. It crosses Ontario, then Quebec, and constitutes the international border between the United States and Canada in the Ontario part.','https://en.wikipedia.org/wiki/Saint_Lawrence_River','https://instagram.com/bassaintlaurent','Congratulations for unlocking the Saint Lawrence badge!','I made it! I unlocked the Saint Lawrence badge with @Withings ! #StepsChallenge http://within.gs/map/en/jta/t',NULL);
INSERT INTO badges VALUES(542,19711056,40,'t_40_5_sum_14','New Badge','Great Britain',1200,'km','1 200 km, crossing Great Britain.','Great Britain is an island on the northwest coast of continental Europe. It represents the majority of the territory in the United Kingdom.','https://en.wikipedia.org/wiki/Great-Britain','https://instagram.com/lovegreatbritain/','Congratulations for unlocking the Great Britain badge!','Good news! I unlocked the Great Britain badge with @Withings ! #StepsChallenge http://within.gs/map/en/8hr/t',NULL);
INSERT INTO badges VALUES(543,19711056,40,'t_40_5_sum_15','New Badge','Cuba',1300,'km','1 300 km, the length of Cuba.','Cuba is the largest island in the Antilles. The island of Cuba has a very elongated shape which recalls that of a caiman.','https://en.wikipedia.org/wiki/Cuba','https://instagram.com/cuba_gallery/','Congratulations for unlocking the Cuba badge!','Finally! I unlocked the Cuba badge with @Withings ! #StepsChallenge http://within.gs/map/en/65t/t',NULL);
INSERT INTO badges VALUES(544,19711056,40,'t_40_5_sum_16','New Badge','Lake Victoria',1400,'km','1 400 km, tour of Lake Victoria.','Lake Victoria or Nyanza is the largest lake in Africa. Located in eastern Africa at the heart of a densely populated area, it is surrounded by Kenya, Uganda and Tanzania. It is the source of the White Nile, the longest tributary of the Nile.','https://en.wikipedia.org/wiki/Lake_Victoria','https://instagram.com/tanzania_safari/','Congratulations for unlocking the Lake Victoria badge!','Look! I unlocked the Lake Victoria badge with @Withings ! #StepsChallenge http://within.gs/map/en/49c/t',NULL);
INSERT INTO badges VALUES(545,19711056,40,'t_40_5_sum_17','New Badge','Lake Malawi',1500,'km','1 500 km, tour of Lake Malawi.','Lake Malawi is a lake in eastern Africa and was formerly called Lake Nyasa. It is the southernmost lake in the Rift Valley. One of the characteristics of Lake Malawi is the exceptional wealth of its aquatic fauna.','https://en.wikipedia.org/wiki/Lake_Malawi','https://instagram.com/destination_malawi/','Congratulations for unlocking the Lake Malawi badge!','Awesome! I unlocked the Lake Malawi badge with @Withings ! #StepsChallenge http://within.gs/map/en/b4f/t',NULL);
INSERT INTO badges VALUES(546,19711056,40,'t_40_5_sum_18','New Badge','Honshu Island',1600,'km','1 600 km, the length of the island of Honshu.','Honshū, literally "main province", is the largest island in Japan and is the site of Tokyo, the Japanese capital.','https://en.wikipedia.org/wiki/Honsh%C5%AB','https://instagram.com/japan_tourism/','Congratulations for unlocking the Honshu Island badge!','I did it! I unlocked the Honshu Island badge with @Withings ! #StepsChallenge http://within.gs/map/en/4qr/t',NULL);
INSERT INTO badges VALUES(547,19711056,40,'t_40_5_sum_19','New Badge','Lake Superior',1700,'km','1 700 km, tour of Lake Superior.','Lake Superior is the largest of the North American Great Lakes and is the world''s largest freshwater lake in surface area. It is located on the border between the United States and Canada.','https://en.wikipedia.org/wiki/Lake_Superior','https://instagram.com/puremichigan/','Congratulations for unlocking the Lake Superior badge!','I made it! I unlocked the Lake Superior badge with @Withings ! #StepsChallenge http://within.gs/map/en/yza/t',NULL);
INSERT INTO badges VALUES(548,19711056,40,'t_40_5_sum_20','New Badge','Gulf of Thailand',1800,'km','1 800 km, tour of the Gulf of Thailand.','The Gulf of Thailand, also known as the Gulf of Siam, is an Asian gulf adjacent to the South China Sea. Covering 320,000 km², the Gulf is relatively shallow, with an average depth of 45 m and a maximum depth of 80 m.','https://en.wikipedia.org/wiki/Gulf_of_Thailand','https://instagram.com/amazingthailand','Congratulations for unlocking the Gulf of Thailand badge!','Good news! I unlocked the Gulf of Thailand badge with @Withings ! #StepsChallenge http://within.gs/map/en/dzg/t',NULL);
INSERT INTO badges VALUES(549,19711056,40,'t_40_5_sum_21','New Badge','New Zealand',1900,'km','1 900 km, crossing New Zealand.','New Zealand is a country of Oceania in the southwest Pacific Ocean. It has an exceptionally rich endemic flora and fauna, ranging from giant kauris to weta insects, by way of kapongas and kiwis.','https://en.wikipedia.org/wiki/New_Zealand','https://instagram.com/purenewzealand/','Congratulations for unlocking the New Zealand badge!','Finally! I unlocked the New Zealand badge with @Withings ! #StepsChallenge http://within.gs/map/en/1gh/t',NULL);
INSERT INTO badges VALUES(550,19711056,40,'t_40_5_sum_22','New Badge','Madagascar',2000,'km','2 000 km, crossing Madagascar.','Madagascar is a country in southern Africa located on the west side of the Indian Ocean and separated from the African continent by the 415-kilometer-long Mozambique Canal. Madagascar is often called the "Island Continent" or the "Red Island."','https://en.wikipedia.org/wiki/Madagascar','https://instagram.com/madagascarlandscape/','Congratulations for unlocking the Madagascar badge!','Look! I unlocked the Madagascar badge with @Withings ! #StepsChallenge http://within.gs/map/en/5ga/t',NULL);
INSERT INTO badges VALUES(551,19711056,40,'t_40_5_sum_23','New Badge','Irrawaddy River',2200,'km','2 200 km, the length of this river in Burma.','The Irrawaddy River originates from the confluence of the Mali and N''mai rivers. It is Burma’s largest river and flows from the north to the south of the country before emptying into the Indian Ocean.','https://en.wikipedia.org/wiki/Irrawaddy_River','https://instagram.com/myanmarphotos/','Congratulations for unlocking the Irrawaddy River badge!','Good news! I unlocked the Irrawaddy River badge with @Withings ! #StepsChallenge http://within.gs/map/en/3vp/t',NULL);
INSERT INTO badges VALUES(552,19711056,40,'t_40_5_sum_24','New Badge','Colorado River',2300,'km','2 300 km, the length of this river in North America.','This river takes its source from the Rocky Mountains. It crosses seven US States and part of Mexico where it empties into the Gulf of California.','https://en.wikipedia.org/wiki/Colorado_River','https://instagram.com/coloradoriver/','Congratulations for unlocking the Colorado River badge!','Finally! I unlocked the Colorado River badge with @Withings ! #StepsChallenge http://within.gs/map/en/8cp/t',NULL);
INSERT INTO badges VALUES(553,19711056,40,'t_40_5_sum_25','New Badge','River Ganges',2500,'km','2 500 km, the length of this river in India.','The Ganges is the most sacred of India’s seven sacred rivers. It rises in the Himalayas and flows through India into Bangladesh, before emptying into the Bay of Bengal.','https://en.wikipedia.org/wiki/Ganges','https://www.instagram.com/explore/tags/gange/','Congratulations for unlocking the River Ganges badge!','Look! I unlocked the River Ganges badge with @Withings ! #StepsChallenge http://within.gs/map/en/4ga/t',NULL);
INSERT INTO badges VALUES(554,19711056,40,'t_40_5_sum_26','New Badge','Zambezi River',2600,'km','2 600 km, the length of this river in Africa.','The Zambezi is one of Africa’s longest rivers. It flows through the east of Angola and through Mozambique, passing by the famous Victoria Falls and finally emptying into the Indian Ocean.','https://en.wikipedia.org/wiki/Zambezi','https://instagram.com/tourismzambia/','Congratulations for unlocking the Zambezi River badge!','Awesome! I unlocked the Zambezi River badge with @Withings ! #StepsChallenge http://within.gs/map/en/7fa/t',NULL);
INSERT INTO badges VALUES(555,19711056,40,'t_40_5_sum_27','New Badge','Danube',2800,'km','2 800 km, the length of this river in Europe.','The Danube is the second longest river in Europe after the Volga (which flows through Russia). It empties into the Black Sea in Ukraine and Romania.','https://en.wikipedia.org/wiki/Danube','https://instagram.com/budapest_hungary/','Congratulations for unlocking the Danube badge!','I did it! I unlocked the Danube badge with @Withings ! #StepsChallenge http://within.gs/map/en/2ze/t',NULL);
INSERT INTO badges VALUES(556,19711056,40,'t_40_5_sum_28','New Badge','Australia’s East Coast',3000,'km','3 000 km, the length of this coast.','Australia’s East Coast is a classic among hikers. It extends from Sydney in the south to Cairns in the north.','https://en.wikipedia.org/wiki/Australia','https://instagram.com/greatbarrierreefqld/','Congratulations for unlocking the Australia’s East Coast badge!','I made it! I unlocked the Australia’s East Coast badge with @Withings ! #StepsChallenge http://within.gs/map/en/1po/t',NULL);
INSERT INTO badges VALUES(557,19711056,40,'t_40_5_sum_29','New Badge','Caspian Sea',3500,'km','3 500 km, the length around this sea.','The Caspian sea is the largest enclosed inland body of water. Its surface area is larger than Germany. Its size and salinity levels mean it is often called a sea, although it is officially a lake.','https://en.wikipedia.org/wiki/Caspian_Sea','https://instagram.com/azerbaijan_lover/','Congratulations for unlocking the Caspian Sea badge!','Finally! I unlocked the Caspian Sea badge with @Withings ! #StepsChallenge http://within.gs/map/en/ar8/t',NULL);
INSERT INTO badges VALUES(558,19711056,40,'t_40_5_sum_30','New Badge','Route 66',4000,'km','4 000 km, the distance of this famous American highway.','Route 66 crosses three time zones and eight states. It was the first asphalt-covered transcontinental highway of the United States. During the Great Depression in the 1930s, farmers took Route 66 to travel to California in search of work.','https://en.wikipedia.org/wiki/U.S._Route_66','https://instagram.com/laroute66/','Congratulations for unlocking the Route 66 badge!','Good news! I unlocked the Route 66 badge with @Withings ! #StepsChallenge http://within.gs/map/en/fr1/t',NULL);
INSERT INTO wellnessprograms VALUES(33,19711056,4,'Pregnancy Tracker','Every pregnancy journey can use a reliable guide. Get quality information and weekly weight insights to help you stay on track and healthy.','Big changes are underway! Pregnancy Tracker offers well-timed advice, tips, and easy weight tracking throughout your entire pregnancy journey. Each week you’ll get obstetrician-reviewed information about what to expect and data and insights on how much weight you’ve gained. Here’s to a healthy, happy pregnancy!','[{"imageUrl":"https://static.withings.com/content/app/healthmate/programs/img/assets/devices_assets/jpg/5.jpg","model":5,"required":false},{"imageUrl":"https://static.withings.com/content/app/healthmate/programs/img/assets/devices_assets/jpg/6.jpg","model":6,"required":false}]','https://static.withings.com/content/app/healthmate/programs/img/pregnancy/pregnancy_1125x843_N.jpg','https://static.withings.com/content/app/healthmate/programs/img/pregnancy/pregnancy_1125x633_N.jpg','[{"image":"https://static.withings.com/content/app/healthmate/programs/img/pregnancy/screenshot_pregnancy_1.png"},{"image":"https://static.withings.com/content/app/healthmate/programs/img/pregnancy/screenshot_pregnancy_2.png"},{"image":"https://static.withings.com/content/app/healthmate/programs/img/pregnancy/screenshot_pregnancy_3.png"}]',NULL,NULL,NULL,'FAMILY','[]','#813395','#6A1B9A',2,44,0,'pregnancyprod','1489051982','1589815962','Join','https://static.withings.com/content/pregnancy/boarding/index.html?mode=men',0);
INSERT INTO wellnessprograms VALUES(34,19711056,16,'Leaderboard','This program helps you stay motivated by bringing a social dimension to meeting and exceeding your activity goals.','You can add your friends and family to your leaderboard and compete with them to be the one who walks the most every week. It doesn’t matter if they have a Nokia product or not: you can add anyone as long as they have the Health Mate app on their smartphone, thanks to the in-app tracking feature that can track steps using their smartphone hardware.','[{"imageUrl":"https://static.withings.com/content/app/healthmate/programs/img/assets/devices_assets/jpg/55.jpg","model":55,"required":false},{"imageUrl":"https://static.withings.com/content/app/healthmate/programs/img/assets/devices_assets/jpg/53.jpg","model":53,"required":false},{"imageUrl":"https://static.withings.com/content/app/healthmate/programs/img/assets/devices_assets/jpg/52.jpg","model":52,"required":false}]','https://static.withings.com/content/app/healthmate/programs/img/leaderboard/img-activity-1125x843_N.jpg','https://static.withings.com/content/app/healthmate/programs/img/leaderboard/img-activity-1125x633_N.jpg','[{"image":"https://static.withings.com/content/app/healthmate/programs/img/leaderboard/screenshot0.jpg"},{"image":"https://static.withings.com/content/app/healthmate/programs/img/leaderboard/screenshot1.jpg"},{"image":"https://static.withings.com/content/app/healthmate/programs/img/leaderboard/screenshot2.jpg"}]',NULL,NULL,NULL,'ACTIVITY','[{"label":"Add friends to your leaderboard","summary":"You can invite people to join your leaderboard. To do so, press the \"+\" button on the welcome screen."},{"label":"Interact with your friends","summary":"Once you have friends in your leaderboard, you can interact with them by tapping their name and selecting one of the three actions available: cheer, flaunt and message."}]','#29B7F7','#46D2EE',1,7,2,'withings-bd2://programs/leaderboard?env=prod','1493132323','1516199578','Join',NULL,1);
INSERT INTO wellnessprograms VALUES(35,19711056,37,'Meditate with Petit BamBou','Designed by Petit BamBou, Europe''s number one meditation app, these 21 mindfulness sessions will help you get going even if you have no previous experience or knowledge.','Join this programme and every morning for 21 days you will receive a meditation session, an instructional video or helpful tips that you can implement by opening your Health Mate app. This is a practice-oriented service. It provides a variety of meditation exercises based on an effective, practical method, while remaining simple and accessible (mindfulness / awareness / positive psychology / sophrology). Petit BamBou teaches you how to train your mind and cultivate a state of peace, serenity and clarity.','[]','https://static.withings.com/content/app/healthmate/programs/img/petitbambou/Img-petitbambou-1125x843.jpg','https://static.withings.com/content/app/healthmate/programs/img/petitbambou/Img-petitbambou-1125x633.jpg','[{"image":"https://static.withings.com/content/app/healthmate/programs/img/petitbambou/screenshot0.jpg"}]','Petit BamBou','https://static.withings.com/content/app/healthmate/programs/img/assets/sponsors/petitbambou.jpg','Research in psychology and neuroscience has advanced considerably, focusing on the benefits of meditation (see books by Jon Kabat-Zinn, Christophe André, Matthieu Ricard and Fabrice Midal). Meditation is very effective for stress, anxiety, fear, burnout, attention deficit disorder, insomnia, addiction, concentration, focus, performance, decision-making, pain, hypertension, diabetes, inflammation, compassion, relationships, self-esteem and social anxiety, self-compassion, children, ageing, relaxation and more.','MINDFULNESS','[{"label":"Get access to the first 21 sessions.","summary":"Just sit down for 10 minutes and listen. You don\u0027t have to do anything!"},{"label":"Learn simple meditation techniques (video and text).","summary":"Purchase a premium subscription for unlimited access to all Petit BamBou programmes."},{"label":"Check out the Petit BamBou app","summary":"If you\u0027re happy with this introduction to meditation, then please feel free to download the Petit BamBou app."}]','#FD7553','#DA502D',1,21,3,'http://petitbambou.com/','1551112982','1561020665','Join',NULL,1);
INSERT INTO wellnessprograms VALUES(36,19711056,38,'Health Insights','Emerging trends and notable achievements','Health Mate now features an engaging chat that will highlight key data, emerging trends, and notable achievements. Health Mate is now able to scan all health data to provide personalized insights, along with relevant medical information and clear, actionable tips that can help anyone manage or improve overall health.','[{"imageUrl":"https://static.withings.com/content/app/healthmate/programs/img/assets/devices_assets/jpg/6.jpg","model":6,"required":false},{"imageUrl":"https://static.withings.com/content/app/healthmate/programs/img/assets/devices_assets/jpg/5.jpg","model":5,"required":false},{"imageUrl":"https://static.withings.com/content/app/healthmate/programs/img/assets/devices_assets/jpg/4.jpg","model":4,"required":false},{"imageUrl":"https://static.withings.com/content/app/healthmate/programs/img/assets/devices_assets/jpg/43.jpg","model":43,"required":false},{"imageUrl":"https://static.withings.com/content/app/healthmate/programs/img/assets/devices_assets/jpg/63.jpg","model":63,"required":false},{"imageUrl":"https://static.withings.com/content/app/healthmate/programs/img/assets/devices_assets/jpg/55.jpg","model":55,"required":false}]','https://static.withings.com/content/app/healthmate/programs/img/weightcoach/img-weightcoach-1125x633.jpg','https://static.withings.com/content/app/healthmate/programs/img/weightcoach/img-weightcoach-1125x843.jpg','[{"image":"https://static.withings.com/content/app/healthmate/programs/healthcoach/media/screenshot0.png"}]','Withings','https://static.withings.com/content/app/healthmate/programs/img/assets/sponsors/withings.png','Master your vitals','Insights','[]','#999999','#4d4d4d',1,99999,3,'http://weightcoach.withings.com/','1558950857','1595946463','Join',NULL,1);
