PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE android_metadata (locale TEXT);
CREATE TABLE objectives(id INTEGER PRIMARY KEY AUTOINCREMENT,x REAL NOT NULL,unit INTEGER NOT NULL,value REAL NOT NULL,type INTEGER,y REAL NOT NULL,algoVersion INTEGER,appVersion INTEGER,platform INTEGER,user INTEGER REFERENCES users (id) ON DELETE CASCADE,wsid INTEGER);
CREATE TABLE leaderboard(id INTEGER PRIMARY KEY AUTOINCREMENT,date TEXT,firstname TEXT,lastname TEXT,userid INTEGER,score INTEGER,imageurl INTEGER);
CREATE TABLE aggregatewam(id INTEGER PRIMARY KEY AUTOINCREMENT,user INTEGER REFERENCES users (id) ON DELETE CASCADE,synchrotime INTEGER,midnight INTEGER,timezone TEXT,day TEXT,calories REAL,earnedCalories REAL,passivecalories REAL,steps INTEGER,distance REAL,ascent REAL,descent REAL,inactiveDuration REAL,softMETDuration REAL,moderateMETDuration REAL,intenseMETDuration REAL,synctows INTEGER,brand INTEGER,devicemodel INTEGER,modified INTEGER,manualAdditionCalories REAL,manualAdditionDistance REAL,hrAverage REAL,hrMin INTEGER,hrMax INTEGER,hrZoneLight INTEGER,hrZoneModerate INTEGER,hrZoneIntense INTEGER,hrZonePeak INTEGER,isCompleted INTEGER,averageSpo2 REAL,nbMeasureAuto INTEGER,nbMeasureManual INTEGER);
CREATE TABLE measuregroup(id INTEGER PRIMARY KEY AUTOINCREMENT,wsid INTEGER NOT NULL,probereply TEXT REFERENCES probe(mac) ON DELETE CASCADE,attrib INTEGER NOT NULL,date INTEGER NOT NULL DEFAULT CURRENT_TIMESTAMP,category INTEGER NOT NULL,maintype INTEGER NOT NULL,origin TEXT,devtype INTEGER,modified INTEGER NOT NULL DEFAULT 0,deleted INTEGER NOT NULL DEFAULT 0,synctows INTEGER NOT NULL,algo INTEGER,deviceid INTEGER NOT NULL DEFAULT 0,brand INTEGER NOT NULL DEFAULT 0,user INTEGER,comment TEXT);
CREATE TABLE measure(id INTEGER PRIMARY KEY AUTOINCREMENT,measuregroup INTEGER REFERENCES measuregroup(id) ON DELETE CASCADE,x REAL NOT NULL,unit INTEGER NOT NULL,value REAL NOT NULL,type INTEGER,y REAL NOT NULL,algoVersion INTEGER,appVersion INTEGER,platform INTEGER,user INTEGER);
CREATE TABLE chat(id INTEGER PRIMARY KEY AUTOINCREMENT,senderId INTEGER NOT NULL,receiverId INTEGER NOT NULL,timeStamp INTEGER NOT NULL,message TEXT,state INTEGER,type STRING);
CREATE TABLE probe(mac TEXT PRIMARY KEY,secret TEXT NOT NULL,mfgid TEXT NOT NULL,softversion INTEGER NOT NULL);
CREATE TABLE hfmeasure(id INTEGER PRIMARY KEY AUTOINCREMENT,x REAL NOT NULL,unit INTEGER NOT NULL,value REAL NOT NULL,type INTEGER,y REAL NOT NULL,algoVersion INTEGER,appVersion INTEGER,platform INTEGER,device INTEGER REFERENCES devices (id) ON DELETE CASCADE,probereply TEXT REFERENCES probe(mac) ON DELETE CASCADE);
CREATE TABLE timeline(id INTEGER PRIMARY KEY AUTOINCREMENT,user INTEGER REFERENCES users(id) ON DELETE CASCADE,timestamp INTEGER,type TEXT NOT NULL,customId TEXT NOT NULL,data TEXT,deleted BOOLEAN DEFAULT 0,expirationDate INTEGER DEFAULT 0,sectionTags TEXT NOT NULL,hasBeenSeen BOOLEAN DEFAULT 0);
CREATE TABLE users (id INTEGER PRIMARY KEY AUTOINCREMENT, lastupdate INTEGER, shared INTEGER, firstname TEXT, lastname TEXT, shortname TEXT, gender INTEGER, birthdate INTEGER, fatmethod INTEGER, email TEXT, p4 TEXT, wamscreens TEXT, wam01WakeUp INTEGER, ws50screens TEXT, ws30screens TEXT, ws45screens TEXT, creationdate INTEGER, modifieddate INTEGER, type INTEGER, wbs04screens TEXT, hwa03screens TEXT, wam03screens TEXT, wbs06screens TEXT, workoutscreens TEXT);
CREATE TABLE partners (id INTEGER PRIMARY KEY AUTOINCREMENT, consumerid INTEGER, user INTEGER REFERENCES users (id) ON DELETE CASCADE, lastupdate INTEGER, context TEXT, accessToken TEXT, secret TEXT, clientId TEXT);
CREATE TABLE devices (id INTEGER PRIMARY KEY, userId INTEGER, associationDate INTEGER, lastUseDate INTEGER, modifiedDate INTEGER, macAddress TEXT NOT NULL, firmware INTEGER, preferredLanguage TEXT, latitude REAL, longitude REAL, timezone TEXT, manualGeoloc TEXT, battery INTEGER, batteryState INTEGER, type INTEGER, model INTEGER, color TEXT, impedanceEnabled INTEGER, debugEnabled INTEGER, debugMask INTEGER, upgradeUrl TEXT, linkId INTEGER, klSecret TEXT, name TEXT, network INTEGER, alarmsEnabled INTEGER, notificationsEnabled INTEGER, advertiseKey TEXT, position INTEGER, micMute INTEGER, consumer INTEGER, sensitivity INTEGER, pictures TEXT, glance INTEGER, measurementsInterval INTEGER, udi TEXT, classification INTEGER, trackerWearPosition INTEGER, maxScreenCount INTEGER, vuMeter INTEGER);
CREATE TABLE device_alarm (id INTEGER PRIMARY KEY AUTOINCREMENT, hour INTEGER NOT NULL , minute INTEGER NOT NULL , day INTEGER NOT NULL , device INTEGER REFERENCES devices (id) ON DELETE CASCADE, state INTEGER, span INTEGER, program INTEGER, volume INTEGER, brightness INTEGER, webradio TEXT, year INTEGER, month INTEGER, mday INTEGER, spotifyTag TEXT, spotifyName TEXT, webradioName TEXT, alarmName TEXT, startDate INTEGER, endDate INTEGER);
CREATE TABLE target (id INTEGER PRIMARY KEY AUTOINCREMENT, wsId INTEGER, user INTEGER REFERENCES users (id) ON DELETE CASCADE, type INTEGER, measureType INTEGER, range INTEGER, mantissa INTEGER, exponent INTEGER, active INTEGER, deactivated INTEGER, created INTEGER, modified INTEGER, synced INTEGER);
CREATE TABLE activityCategory (id INTEGER PRIMARY KEY, name TEXT, nameResName TEXT, priority INTEGER, glyphName TEXT, isDistanceRelevant INTEGER, minMet REAL, maxMet REAL, display INTEGER, indoor INTEGER, features TEXT, isAccelerometerReliable INTEGER, modified INTEGER);
CREATE TABLE trace (id INTEGER PRIMARY KEY AUTOINCREMENT, mac TEXT, secret TEXT, mfgId TEXT, softVersion INTEGER, timestamp INTEGERNOT NULL DEFAULT CURRENT_TIMESTAMP, type INTEGER, data TEXT);
CREATE TABLE vasistas (id INTEGER PRIMARY KEY AUTOINCREMENT, user INTEGER REFERENCES users (id) ON DELETE CASCADE, type INTEGER NOT NULL , activitytype INTEGER, timestamp INTEGERNOT NULL DEFAULT CURRENT_TIMESTAMP, duration INTEGER, calories REAL, earnedCalories REAL, met REAL, sleeplevel INTEGER, snoringDurationRatio INTEGER, steps INTEGER, distance REAL, ascent REAL, descent REAL, sleepdebug INTEGER, synctows INTEGER, devicemodel INTEGER NOT NULL, heartrate INTEGER, heartrateQuality INTEGER, skinTemperature INTEGER, activityStatus INTEGER, swimMovements INTEGER, swimLaps INTEGER, category INTEGER, recognitionData2 INTEGER, version INTEGER, swimType INTEGER, deviceId INTEGER, apneaHypopneaIndex INTEGER, breathingProbability INTEGER, pauseType INTEGER, spo2 INTEGER, spo2Quality INTEGER, respiratoryRate INTEGER);
CREATE TABLE track (id INTEGER PRIMARY KEY AUTOINCREMENT, wsId INTEGER, user INTEGER REFERENCES users (id) ON DELETE CASCADE, startDate INTEGER, endDate INTEGER, timezone TEXT, day TEXT, modified INTEGER, deviceModel INTEGER, deviceType INTEGER, attrib INTEGER, type INTEGER, data TEXT, activityRecognitionVersion INTEGER, syncedToWs INTEGER, deleted INTEGER, deletionReason INTEGER, sleepScore TEXT, snoringEnabled INTEGER, note TEXT, manualStartDate INTEGER, manualEndDate INTEGER, blankVasistasFilled INTEGER, inprogress INTEGER, workoutData TEXT, pathlists TEXT, cryptpart TEXT, uris TEXT, coverPictureUrl TEXT, coverPictureUri TEXT);
CREATE TABLE crmFeedback (id INTEGER PRIMARY KEY AUTOINCREMENT, userId INTEGER, crmId TEXT, epoch INTEGER, event TEXT, sent INTEGER);
CREATE TABLE reminderType (typeId INTEGER PRIMARY KEY AUTOINCREMENT, typeWsId INTEGER, categoryId INTEGER, categoryName TEXT, name TEXT, color TEXT, info1 TEXT, info2 TEXT, timelineName TEXT, defaultDays INTEGER, defaultTime INTEGER, image TEXT);
CREATE TABLE reminder (id INTEGER PRIMARY KEY AUTOINCREMENT, wsId INTEGER, created INTEGER, updated INTEGER, muteDate INTEGER, days INTEGER, time INTEGER, enabled INTEGER, reminderTypeWsId INTEGER);
CREATE TABLE badges (localId INTEGER PRIMARY KEY AUTOINCREMENT, userId INTEGER, badgeType INTEGER, id TEXT, title TEXT, subTitle TEXT, value INTEGER, unit TEXT, shortDesc TEXT, longDesc TEXT, learnMoreText TEXT, learnMorePhoto TEXT, message TEXT, shareText TEXT, date TEXT);
CREATE TABLE wellnessprograms (localId INTEGER PRIMARY KEY AUTOINCREMENT, userId INTEGER, programId INTEGER, title TEXT, subtitle TEXT, about TEXT, devices TEXT, imagePreviewUrl TEXT, imageFullUrl TEXT, screenshots TEXT, sponsorName TEXT, sponsorImageUrl TEXT, sponsorDescription TEXT, tags TEXT, features TEXT, mainColor TEXT, labelColor TEXT, durationRange INTEGER, durationValue INTEGER, targetType INTEGER, targetValue TEXT, created TEXT, modified TEXT, cta TEXT, eligibilityUrl TEXT, eligibilityStatus INTEGER);
CREATE TABLE enrolledprograms (localId INTEGER PRIMARY KEY AUTOINCREMENT, userId INTEGER, programId INTEGER, deployment TEXT, programDetails TEXT, programIterations TEXT);
CREATE TABLE logs (timestamp INTEGER, level INTEGER, macAddress TEXT, tag TEXT, message TEXT);
DELETE FROM sqlite_sequence;
CREATE INDEX leaderboard_date ON leaderboard(date);
CREATE INDEX aggregatewam_user_day ON aggregatewam(user, day);
CREATE INDEX aggregatewam_user_synctows_day ON aggregatewam(user, synctows, day);
CREATE INDEX aggregatewam_user_midnight ON aggregatewam(user, midnight);
CREATE INDEX measuregroup_synctows ON measuregroup(synctows);
CREATE INDEX measuregroup_user_date ON measuregroup(user, date);
CREATE INDEX measuregroup_user_origin ON measuregroup(user, origin);
CREATE INDEX measuregroup_wsid ON measuregroup(wsid);
CREATE INDEX measuregroup_user_modified ON measuregroup(user, modified);
CREATE INDEX measure_user_type_x ON measure(user, type, x);
CREATE INDEX hfmeasure_probereply ON hfmeasure(probereply);
CREATE INDEX hfmeasure_device_type_x ON hfmeasure(device, type, x);
CREATE INDEX hfmeasure_device_x ON hfmeasure(device, x);
CREATE INDEX timeline_user_deleted_timestamp ON timeline(user, deleted, timestamp);
CREATE INDEX timeline_user_type_timestamp ON timeline(user, type, timestamp);
CREATE INDEX timeline_user_deleted_sectionTag_timestamp_ ON timeline(user, deleted, sectionTags, timestamp);
CREATE INDEX timeline_user_type_customId ON timeline(user, type, customId);
CREATE INDEX vasistas_user_category_timestamp ON vasistas(user, category, timestamp);
CREATE INDEX track_user_day_type ON track(user, day, type);
CREATE INDEX track_user_deviceType_startDate ON track(user, deviceType, startDate);
CREATE INDEX track_user_syncedToWs ON track(user, syncedToWs);
CREATE INDEX track_user_modified ON track(user, modified);
COMMIT;
